import React from 'react';
import Feature from '../feature/Feature';
import './statsmusic.css';
import minutes from '../../assets/minutes.png';

const Statsmusic = () => {
  return (
    <div className='portfolio-statsmusic'>
        <div className='portfolio-statsmusic-image'>
            <img src={minutes} alt="minutes"/>
        </div>
        <div><Feature Title="Minutes spent listening to Music" Text="Thats about 21 days of the year spent listening to music." Technologies="Hehe"/></div>

    </div>
  )
}

export default Statsmusic
